import { AppBar, Toolbar } from '@mui/material';
import * as React from 'react';
import {
    Stack,
    Container,
    IconButton,
    Box,
    ImageList,
    ImageListItemBar,
    ImageListItem,
    TextField,
    ThemeProvider,
    MenuItem,
    Menu,
    Typography,
  } from "@mui/material";
  import image1 from './images/image1.png';
  import image2 from './images/image2.png';
  import image3 from './images/test.png';
  import image4 from './images/image4.png';
  import image5 from './images/image5.png';

  import video1 from './videos/video1.gif';
  import video2 from './videos/video2.gif';
  import video3 from './videos/video3.gif';

  import List from "./List";

  const itemData = [
    {
      img: image1,
      desc: 'The view when loading up the maze game',
    },
    {
      img: image2,
      desc: 'Burger',
    },
    {
      img: image3,
      desc: 'Camera',
    }, 
    {
      img: image4,
      desc: 'Mushrooms',
    },
    {
      img: image5,
      desc: 'Tomato basil',
    }];

  const videoData = [
    {
      img: video1,
      desc: 'video1',
    },{
      img: video2,
      desc: 'video1',
    },
    {
      img: video3,
      desc: 'video3',
    }
  ];

  function Projects() {
    return (
      <Container
      fixed
      sx={{
        bgcolor: "transparent",
        marginTop: '10vh', 
        marginBottom: '10vh',
      }}
    >
      <Box sx={{ pt: "10px" }}>
        <h1>Maze Game</h1>
        <Box sx={{ mb: "10px", borderBottom: "2px solid white" }}>
          <Typography>Screenshots</Typography>
            <List items={itemData}/>
          <Typography>Gifs</Typography>
            <List items={videoData} />
        </Box>
        <Typography variant="h6">Introduction:</Typography>
      </Box>
    </Container>
    );
  };

  export default Projects;
